import React from 'react';

const data =[
    {
        label:'Home',
        to:'/'
    },
    {
        label:'About Me',
        to:'/about'
    },
    {
        label:'Skills',
        to:'/skills'
    },
    {
        label:'Resume',
        to:'/resume'
    },
    {
        label:'Portfolio',
        to:'/portfolio'
    },
    {
        label:'Contact',
        to:'/contact'
    }
]
const Navbar = () => {
    return (
        <div>
        <nav className='navbar'></nav>
        </div>
    );
}
export default Navbar;
